def fibonacci_2(n):
    if n <= 0:
        return []
    elif n == 1:
        return [0]
    elif n >= 2:
        fib_list = [0, 1]
        if n == 2:
            return fib_list
        next_num(fib_list, n-2)
    return fib_list

def next_num(series, n):
    if n == 0:
        return
    else:
        new_num = series[len(series) - 1] + series [-2]
        series.append(new_num)
        next_num(series, n -1)
